        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby byl následující problém odstraněn, odstraňte ovládací prvky z&nbsp;oblasti výzvy reportu. Například abyste odstranili problémy se&nbsp;střední prioritou, omezte počet ovládacích prvků v&nbsp;oblasti výzvy reportu na 10 nebo méně.</p><p class\\="xis-paragraph">Střední priorita\\: obsahuje &gt; 10&nbsp;objektů v&nbsp;oblasti výzvy reportu.</p></section>',
