        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Udává minimální počet pozorování, která jsou povolena v listu (koncovém uzlu).</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje relativní význam místních účinků na globální účinky při umisťování uzlů a odkazů. Rozmístění uzlů a odkazů je určeno algoritmem účinku. Algoritmus najde umístění uzlů, které u sebe nejsou příliš blízko, a odkazů, které mají přibližně stejnou délku.</p><p class\\="xis-paragraph">Větší hodnota pro <span class\\="xis-windowItem">sílu vynucení</span> obecně vkládá větší vzdálenost mezi uzly v síti.</p></section>',
