        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Správa překryvů</span> určuje akci, která se použije k zobrazení označení sloupců, pokud není dostatek místa k zobrazení a dochází k překryvům.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Automatický</span></td><td>upraví označení automaticky.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Nic</span></td><td>neprovádí správu překryvů.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby byl následující problém odstraněn, omezte počet vlastních kategorií. Například abyste odstranili problémy s&nbsp;nízkou prioritou, omezte počet vlastních kategorií v&nbsp;reportu na 25 nebo méně.</p><p class\\="xis-paragraph">Nízká priorita\\: obsahuje &gt; 25&nbsp;vlastních kategorií</p></section>',
