        "vaeua-gui-eua.Properties.partialdependence.numObs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uvádí minimální počet připomínek ke vzoru ze vstupních dat, které se používají pro generování predikcí modelu, které jsou zobrazeny v grafu částečné závislosti.</p></section>',
