        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Zobrazení hodnoty osové značky</span> určuje metodu, která se používá k dosazení hodnot osových značek na osu X. Můžete zvolit buď možnost <span class\\="xis-windowItem">Automaticky snižovat překrývání</span>, nebo možnost <span class\\="xis-windowItem">Pevná orientace</span>.</p><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Automaticky snižovat překrývání</span> se použije jen v případě, že se hodnoty osových značek překrývají. Můžete zadat následující\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Střídat, vypustit, vložit</span></td><td>posouvá hodnoty střídavě nahoru a dolů, připíná znaky z hodnot osových značek a potom vkládá hodnoty osových značek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otočit o 45°</span></td><td>otáčí všechny hodnoty osových značek diagonálně o 45°.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Střídat, vypustit</span></td><td>posouvá hodnoty osových značek střídavě nahoru a dolů a potom připíná znaky z hodnot osových značek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vypustit</span></td><td>připíná znaky z hodnot osových značek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vypustit, otočit o 45°</span></td><td>připíná znaky z hodnot osových značek a otáčí všechny hodnoty osových značek diagonálně o 45°.</td></tr></table></div>                 </div><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Pevná orientace</span> se použije vždy a nastavuje orientaci hodnot. Můžete zadat následující\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vodorovně</span></td><td>zobrazuje vodorovně hodnoty osových značek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otočit o 45°</span></td><td>otáčí všechny hodnoty osových značek diagonálně o 45°.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otočit o 45°, vložit</span></td><td>otáčí všechny hodnoty osových značek diagonálně o 45° a potom vkládá hodnoty osových značek.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "Další informace o této možnosti ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Provádí zrychlený zpětný výběr proměnných pro stanovení proměnných, které připadají v úvahu pro vytvoření modelu. Zvažují se pouze proměnné s <span class\\="xis-userSuppliedValue">p</span>-hodnotami pod specifikovanou hladinou významnosti.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Načítání první stránky ve vašem reportu trvá příliš dlouho. Pokud SAS Visual Analytics rozpozná jiné problémy s&nbsp;výkonem, než je nízká rychlost načítání, nejprve opravte tyto problémy. Pokud nejsou rozpoznány žádné jiné problémy s&nbsp;výkonem, obraťte se na svého správce, abyste stanovili, zda váš report ovlivňují i&nbsp;nějaké jiné faktory. Pomalé načítání reportu může být například způsobeno pomalým připojením.</p><p class\\="xis-paragraph">Nízká priorita\\: trvá &gt;\\= 5 sekund</p><p class\\="xis-paragraph">Střední priorita\\: trvá &gt;\\= 10 sekund</p><p class\\="xis-paragraph">Vysoká priorita\\: trvá &gt;\\= 25 sekund</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "Nápověda. Další informace o této možnosti ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje aktivační funkci využívanou k vytvoření výstupní vrstvy při použití normálního rozdělení k modelování odezvy. Exponenciální aktivační funkce se používá s&nbsp;rozdělením gama nebo Poissonovým rozdělením. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Zahrnout související datové položky (přiřazení rolí, filtry atd.) do uloženého objektu.</p></section>',
