        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje hodnotu alfa pro ukazatel složitosti, který se používá k prořezání regresního stromu. Výsledkem vyšší hodnoty alfa je menší strom.</p></section>',
