        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje, jestli mají být textové odkazy na tuto stránku skryté pro uživatele, kteří ji nemohou zobrazit. </p><p class\\="xis-paragraph">Pokud tuto možnost nepovolíte, zobrazí se uživatelům, kteří nemají přístup, při pokusu o sledování textového odkazu zpráva s oznámením.</p></section>',
