        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje, zda se používá seznam blokování. Seznam blokování je jednoduchá kolekce pomocných či doplňkových slov, která chcete odebrat z textu. Tato slova musejí být uložena jako sada dat SAS, která je načtená na server CAS.</p></section>',
