        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Využívá výchozí počet prediktorů pro vyzkoušení u jednotlivých rozdělení. Výchozí hodnota je celkový počet prediktorů. Jinak specifikujte počet prediktorů pro vyzkoušení u jednotlivých rozdělení.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Využívá výchozí penalizační hodnotu. Výchozí hodnota je 1.0.</p></section>',
