        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Pokud počet pozorování s chybějícími hodnotami možného prediktoru převyšuje nebo je rovný specifikované minimální hodnotě, potom jsou chybějící hodnoty při vyhledávání možných rozdělení považovány za samostatné hodnoty.</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Mezery</span> určuje mezery mezi sloupci.</p><p class\\="xis-paragraph">Pro seskupené sloupce, které jsou vedle sebe, se mezery zobrazují mezi shluky. Mezi jednotlivými sloupci ve shluku nejsou žádné mezery.</p></section>',
