        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje počáteční (výchozí) hodnotu ovládacího prvku. Počáteční hodnota je vybrána při prvním otevření reportu nebo když uživatel zvolí možnost <span class\\="xis-windowItem">Obnovit výchozí stav reportu</span>. </p><div class\\="xis-paragraph">Zadejte hodnotu do textového pole nebo zadejte jednu z následujících možností\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatické</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že váš výběr bude při ukládání reportu uložen jako počáteční hodnota. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Minimální hodnota</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> určuje, že nejmenší hodnota v ovládacím prvku je počáteční hodnotou.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maximální hodnota</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> určuje, že největší hodnota v ovládacím prvku je počáteční hodnotou.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parametr-název</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že hodnota parametru, který vyberete, je počáteční hodnotou pro ovládací prvek.</p><p class\\="xis-paraSimple">Parametr můžete vybrat pouze v případě, že parametr s příslušným typem dat již existuje.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.tip.txt": "Další informace o této možnosti ",
