        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Pořadí spojení</span> určuje, jak budou datové body spojeny, aby tvořily čáry grafu. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Osa</span></td><td>spojí datové body tak, jak se zobrazují zleva doprava na ose X.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Data</span></td><td>spojí datové body v pořadí, ve kterém jsou čteny z role X.</td></tr></table></div>                 </div><p class\\="xis-paragraph">Tato hodnota umožňuje zajistit uspořádané spojení, když vstupní data nejsou seřazena podle role X.</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje maximální počet vektorů podpory. Skutečný počet vektorů podpory může být mírně vyšší než stanovený počet vzhledem k povaze metody active-set.</p></section>',
