        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost automatického nadpisu se nemusí týkat některých objektů, jako jsou klíčové hodnoty.</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje velikost kroku učení pro algoritmus SGD. Pomalejší učení může zabránit přeučení (overfittingu) modelu. Hodnota kroku učení může být upravena tak, aby optimalizační algoritmus efektivně konvergoval.</p></section>',
        "vaeua-gui-eua.Properties.predAuto.numGroups.help.aria.txt": "Nápověda. Další informace o této možnosti ",
        "vaeua-gui-eua.Properties.svm.customPenaltyValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje penalizační hodnotu, která se použije. Vyšší penalizační hodnota má obecně za následek menší počet podpůrných vektorů.</p></section>',
