        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Pokusí se vytvořit naivní Bayesovu síť rozšířenou o strom, která zahrnuje přímé propojení proměnné odezvy s&nbsp;každým prediktorem a stromovou strukturu mezi prediktory. Naivní Bayesova síť rozšířená o strom vyžaduje, aby maximální počet nadřazených prvků byl vždy dva.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.aria.txt": "Nápověda. Další informace o této možnosti ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.maxNodeCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje granularitu rozvržení sítě.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Pokusí se vytvořit Bayesovu síť nadřazených-podřízených, která rozšiřuje naivní Bayesovu síť. Rozšíření umožňuje, aby prediktory byly nadřazenými prvky odezvy proměnné a umožňuje propojení nadřazených a podřízených prvků odezvy proměnné a propojení podřízených prvků odezvy proměnné.</p></section>',
