        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Udává hloubku pro percentilové intervaly, které se používají k výpočtu statistik souvisejících s liftem. Ty zahrnují pozorovaný průměr, lift, kumulativní lift, kumulativní procento zachycení a kumulativní procento událostí.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje, zda jsou odkazy mezi uzly směrované (jednosměrné) nebo nesměrované (obousměrné). Typ odkazu ovlivňuje výpočet síťových metrik. Když jsou zobrazeny odkazové šipky, typ odkazu určuje směr odkazových šipek.</p></section>',
