        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.maxPolylines.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje maximální počet polyčar, které lze generovat algoritmem paralelních souřadnic. Zvýšení této hodnoty umožňuje podrobnější rozdělení na intervaly.</p></section>',
