        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Zobrazení hodnoty osové značky</span> určuje metodu, která se používá k dosazení hodnot osových značek na osu X. Můžete zvolit buď možnost <span class\\="xis-windowItem">Automaticky snižovat překrývání</span>, nebo možnost <span class\\="xis-windowItem">Pevná orientace</span>.</p><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Automaticky snižovat překrývání</span> se použije jen v případě, že se hodnoty osových značek překrývají. Můžete zadat následující\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vložit některé</span></td><td>vkládá některé hodnoty osových značek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otočit o 45°</span></td><td>otáčí všechny hodnoty osových značek diagonálně o 45°.</td></tr></table></div>                 </div><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Pevná orientace</span> se použije vždy a nastavuje orientaci hodnot. Můžete zadat následující\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vodorovně</span></td><td>zobrazuje vodorovně hodnoty osových značek.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otočit o 45°</span></td><td>otáčí všechny hodnoty osových značek diagonálně o 45°.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otočit o 45°, vložit</span></td><td>otáčí všechny hodnoty osových značek diagonálně o 45° a potom vkládá hodnoty osových značek.</td></tr></table></div>                 </div></section>',
