        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Rozšiřuje model o přidaná pozorování s chybějícími hodnotami. Kontinuální efekt se dopočítá pomocí pozorovaného průměru a vytvoří se indikátorová proměnná, která označuje absenci. Klasifikační (kategoriální) efekt nakládá s chybějícími hodnotami jako s rozdílnou úrovní. </p></section>',
