        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Zobrazuje nejvíce doporučované nebo nejméně doporučované kategorie pro jednotlivé klasifikační proměnné. Před výběrem prediktoru musíte přiřadit alespoň jeden prediktor.</p></section>',
