        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Udává počet shluků, které se mají vytvořit, nebo určuje, že se má optimální počet shluků odvodit pomocí metody ABC (Aligned Box Criterion).</p><p class\\="xis-paragraph">Metoda ABC nejprve vybere určitý počet shluků, které se budou vytvářet, vytvoří shluky a pro jednotlivé shluky vypočítá gap statistiku. Pak se vytvoří referenční distribuce orientovaná kolem jednotlivých shluků a pro každou referenční distribuci se vypočítá gap statistika. Tento postup se opakuje pro celý potenciální počet shluků. Počet shluků, který maximalizuje celkový rozdíl mezi gap statistikou shluků a referenčními daty, se vybere jako optimální počet shluků.</p><p class\\="xis-paragraph">Metoda ABC je platná jen v případě, že všechny vstupy jsou proměnnými měření.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Další informace o této možnosti ",
