        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Využívá výchozí počet prediktorů pro vyzkoušení u jednotlivých rozdělení. Výchozí hodnota je druhá odmocnina celkového počtu prediktorů. Jinak specifikujte počet prediktorů pro vyzkoušení u jednotlivých rozdělení.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uvádí počet přihrádek, které se používají ke kategorizování proměnných ukazatele v grafu částečné závislosti.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Povoluje rychlý algoritmus k-means clustering a ignoruje pořadí intervalů. Tuto možnost nevybírejte, pokud si přejete použít agresivní vyhledávací algoritmus a respektovat pořadí intervalů. Odezvy ukazatelů nerozdělené do intervalů využívají odchylek jako kritérií výběru. Pokud vyberete tuto možnost, odezvy kategorií a odezvy intervalových ukazatelů využívají kritérium poměru zisků. V opačném případě se používá absolutní zisk.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.tip.txt": "Další informace o této možnosti ",
