        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Pokusí se vytvořit naivní Bayesovu síť a naivní Bayesovu síť rozšířenou o Bayesovu síť. Naivní Bayesova síť udává, že proměnná odezvy je jediným nadřazeným prvkem všech prediktorů. Předpokládá podmíněnou nezávislost všech prediktorů vůči proměnné odezvy. Naivní Bayesova síť rozšířená o Bayesovu síť rozšiřuje naivní síť tím, že umožní uzlům prediktorů vytvořit Bayesovu síť.</p></section>',
