        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje relativní počet komunit (seskupení místních uzlů) k výpočtu. Komunity se aktualizují dynamicky při změně sítě.</p></section>',
