        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje úroveň přizpůsobení, které může každý uživatel aplikovat na svoje zobrazení reportu. Každá úroveň zahrnuje úrovně pod ní.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Generuje vlastní tagy HTML, aby objekt nebo report mohl být vnořen na webovou stránku.</p><p class\\="xis-paragraph">Pro povolení vlastních tagů na vaší webové stránce musíte také přidat tagy &lt;script&gt; na záhlaví vaší stránky. Další informace o vkládání obsahu SAS Visual Analytics naleznete v <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">dokumentaci sady SDK pro SAS Visual Analytics</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Mezery mezi shluky</span> řídí šířku mezer mezi shluky pro seskupené sloupce. Pokud chcete změnit mezeru mezi sloupci, zadejte možnost <span class\\="xis-windowItem">Mezery</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Typ skupiny <span class\\="xis-windowItem">Odlišné hodnoty</span> je k dispozici pouze pro měření s nižším počtem jedinečných hodnot.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Udává počet intervalů, které se používají ke kategorizaci odezvy ukazatele.</p></section>',
