        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje počáteční maximální hodnotu (horní mez) pro ovládací prvek. Počáteční hodnota je vybrána při prvním otevření reportu nebo když uživatel zvolí možnost <span class\\="xis-windowItem">Obnovit výchozí stav reportu</span>. </p><div class\\="xis-paragraph">Zadejte hodnotu do textového pole nebo zadejte jednu z následujících možností\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatické</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že váš výběr bude při ukládání reportu uložen jako počáteční hodnota. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maximální hodnota</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že největší hodnota v ovládacím prvku je počáteční hodnotou.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parametr-název</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že hodnota parametru, který vyberete, je počáteční hodnotou pro ovládací prvek.</p><p class\\="xis-paraSimple">Parametr můžete vybrat pouze v případě, že parametr s příslušným typem dat již existuje.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Nápověda. Další informace o této možnosti ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Určuje, jakým způsobem se pro výpočet cestovní doby grafického prvku používá doprava. Vyberte jednu z následujících možností\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Ne</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že výpočet cestovní doby používá vážený průměr historických údajů pro všechny denní doby a pro všechny dny v týdnu.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Aktuální provoz</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">určuje, že výpočet doby jízdy používá aktuální dopravní podmínky. Tato data provozu lze aktualizovat kliknutím na ikonu <span data-icon-name\\="refresh" alt\\="Aktualizovat data provozu" aria-label\\="Aktualizovat data provozu"></span>. Když uživatel zobrazí zprávu, provoz se automaticky neaktualizuje. Uživatel musí aktualizovat data provozu tak, aby odrážely nejnovější podmínky provozu.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Typický provoz</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> určuje, že výpočet cestovní doby používá typický provoz pro zadaný čas a den v týdnu. Typické dopravní podmínky vycházejí z nedávných historických údajů.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Poznámka\\:</span> Čas, který zadáte, je místní čas pro místo na mapě.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Poznámka\\:</span>Získání dat o čase jízdy spotřebovává kredity Esri Premium Services.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Poznámka\\:</span>Pokud pro oblast, která obsahuje výpočet cestovní doby, nejsou k dispozici žádné dopravní údaje, použijí se pro výpočet cestovní doby stanovené rychlostní limity.</div></section>',
