        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Vyberte proměnnou, kterou chcete použít k&nbsp;rozdělení uzlu. Proměnné se řadí podle logaritmické hodnoty, která udává, jak dobře daná proměnná rozděluje data. Logaritmická hodnota je záporným logaritmem p-hodnoty z testu chí-kvadrátů.</p></section>',
