        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Používá výchozí minimální absolutní toleranci, při které se zastaví iterace. Výchozí hodnota je 1.0E-6.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby byl následující problém odstraněn, odstraňte ovládací prvky z&nbsp;oblasti výzvy stránky. Například abyste odstranili problémy se&nbsp;střední prioritou, omezte počet ovládacích prvků v&nbsp;oblasti výzvy stránky na 10 nebo méně.</p><p class\\="xis-paragraph">Střední priorita\\: obsahuje &gt; 10&nbsp;objektů v&nbsp;oblasti výzvy stránky.</p></section>',
