        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby byl následující problém odstraněn, odeberte výpočty. Například abyste odstranili problémy s&nbsp;nízkou prioritou, omezte počet výpočtů v&nbsp;reportu na 14 nebo méně.</p><p class\\="xis-paragraph">Nízká priorita\\: obsahuje &gt;\\= 15 výpočtů</p></section>',
