        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">U každého prediktoru testuje podmíněnou nezávislost proměnné odezvy vůči veškerým ostatním prediktorům na základě specifikované statistiky testu nezávislosti. Možnost <span class\\="xis-windowItem">Výběr proměnných</span> zamítne prediktory, které jsou podmíněně nezávislé na hodnotě odezvy vůči veškerým dalším prediktorům.</p></section>',
