        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aby byly následující problémy odstraněny, upravte rozvržení reportu tak, aby neobsahovalo vnořené kontejnery. Například abyste odstranili problémy s&nbsp;vysokou prioritou, zajistěte, aby rozvržení reportu obsahovalo maximálně 6&nbsp;vnořených kontejnerů.</p><p class\\="xis-paragraph">Nízká priorita\\: obsahuje &gt; 2&nbsp;vnořené kontejnery</p><p class\\="xis-paragraph">Střední priorita\\: obsahuje &gt; 4&nbsp;vnořené kontejnery</p><p class\\="xis-paragraph">Vysoká priorita\\: obsahuje &gt; 6&nbsp;vnořených kontejnerů</p></section>',
