        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje míru žíhání pro použití při optimalizaci SGD. Nenulová hodnota pomáhá modelu konvergovat poblíž místního minima cílové funkce.</p></section>',
