        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje maximální chybu ověření přijatelnou pro kompletní učení modelu. Pokud je chyba ověření nižší než specifikovaná cílová hodnota, bude učení modelu ukončeno.</p></section>',
