        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje distribuční funkci, která se používá k modelování proměnné odezvy.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Obrácení stylu datového prvku</span> určuje, jak jsou styly přiřazeny k datovým prvkům v šabloně grafu. V čárovém grafu například tato možnost určuje, jak se budou barvy, vzory čáry a značky používat k odlišení čar v grafu. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatické</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">používá nastavení otočení stylu z motivu. Většina motivů SAS používá nastavení <span class\\="xis-windowItem">Nejprve obrátit všechny barvy</span>. Motiv High Contrast používá nastavení <span class\\="xis-windowItem">Obrátit všechny atributy</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Nejprve obrátit všechny barvy</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">zobrazuje souvislou výplň, plnou čáru a konzistentní tvar značky, dokud nebudou použity všechny barvy palety.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Obrátit všechny atributy</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">kromě různých barev zobrazuje různé vzory výplně, vzory čáry a tvar značek. Toto nastavení může vylepšit přístupnost pro uživatele s problémy s rozlišením barev (barvoslepost).</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Nápověda. Další informace o této možnosti ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Určuje parametr měřítka (koeficientu) ve funkci sigmoid.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifikuje počet komunit (seskupení místních uzlů) pro výpočet v každém shluku uzlů. Celkový vypočtený počet komunit může být nižší než vybraná hodnota v&nbsp;závislosti na struktuře a velikosti sítě.</p></section>',
