        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kategorické prediktory považují chybějící hodnotu za samostatnou hodnotu. Kontinuální prediktor nahradí chybějící hodnotu průměrem prediktoru. U bayesovských sítí nejsou chybějící hodnoty zahrnuty do proměnné odpovědi.</p></section>',
