        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Další informace o této možnosti ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Měřítko seskupení</span> určuje měřítko pro seskupené sloupcové grafy. Sloupce mohou být nad sebou nebo vedle sebe. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Skutečné hodnoty</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">upraví velikost sloupců na základě hodnot v datech. Předpokládejme například, že sloupec v jedné skupině má hodnotu 50 a sloupec v další skupině má hodnotu 500. Tento sloupec by byl 10krát vyšší než 50 sloupců.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Nastavit skupiny na 100 %</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">znázorňuje skupiny pomocí relativního měřítka. Každý sloupec ve skupině se zobrazuje jako procentuální část dané skupiny. Předpokládejme například, že skupina má celkovou hodnotu 100. Pokud má sloupec v této skupině hodnotu 50, představuje 50 % výšky celé skupiny.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Tato možnost není k dispozici, když objekt grafu obsahuje překryté prvky grafu. Tato možnost také není k dispozici, když specifikujete stejné datové rozpětí pro osy v mřížce.</p></section>',
